"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Hiccups (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hiccups-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H11954436\">",
"      <span class=\"h1\">",
"       What are hiccups?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hiccups happen when your diaphragm, the muscle that separates your chest from your belly, suddenly contracts. When that happens, you take in air, and then your voice box closes shut, which is what causes the &ldquo;hic&rdquo; sound.",
"     </p>",
"     <p>",
"      There are different types of hiccups, named after how long they last:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A &ldquo;regular&rdquo; bout of hiccups can last up to 48 hours",
"       </li>",
"       <li>",
"        &ldquo;Persistent hiccups&rdquo; last longer than 48 hours and up to a month",
"       </li>",
"       <li>",
"        &ldquo;Intractable hiccups&rdquo; last longer than a month",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In most cases, hiccups go away on their own with no lasting effects. But in some people, they can last a long time and lead to problems such as poor nutrition, tiredness, and reduced appetite.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11954451\">",
"      <span class=\"h1\">",
"       What causes hiccups?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common causes include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Having an overly full stomach",
"       </li>",
"       <li>",
"        Drinking soda or other fizzy drinks",
"       </li>",
"       <li>",
"        Swallowing air (for example when you are chewing gum)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In rare situations, hiccups can have more serious causes, such as infections or irritation of a nerve in the neck or diaphragm.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11954466\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to get rid of the hiccups?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, there are a few things you can try:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Hold your breath for several seconds or longer",
"       </li>",
"       <li>",
"        Breathe out against your closed mouth and nose (the way you might do on an airplane to pop your ears)",
"       </li>",
"       <li>",
"        Stimulate the back of your throat, for example by sipping cold water, gargling with water, or swallowing a teaspoon of sugar",
"       </li>",
"       <li>",
"        Pull your knees up to your chest and lean forward",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11954489\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse if you have hiccups that last longer than 48 hours. He or she will do an exam and ask about your symptoms. Most cases of hiccups are harmless. But the doctor or nurse might want to do a few tests, depending on your symptoms, medical history, and what the exam shows.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11954504\">",
"      <span class=\"h1\">",
"       How are hiccups treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If the self-help steps listed above do not help enough, there are a number of prescription medicines that can help. There are also procedures, such as acupuncture or surgery to treat hiccups, but they are only for people with extreme symptoms who do not get better with other treatments.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11954519\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
