"     <a class=\"outlineLink\" href=\"#H11954436\">",
"      What are hiccups?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H11954451\">",
"      What causes hiccups?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H11954466\">",
"      Is there anything I can do on my own to get rid of the hiccups?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H11954489\">",
"      Should I see a doctor or nurse?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H11954504\">",
"      How are hiccups treated?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H11954519\">",
"      More on this topic",
"     </a>",
"    </li>",
"   </ul>",
"  </div>",
