"   </div>",
"   <div class=\"lgnd\">",
"    Typical daily water balance in a normal human, assuming a low rate of sweat production. When exercise and/or hot weather stimulates sweat production, water losses from the skin can increase markedly, occasionally exceeding 5 L/day. In this setting, the ensuing rise in plasma osmolality stimulates thirst, resulting in an appropriate increase in water intake.",
